import React, { Component } from 'react';
import './style.css';

class Vip extends Component {

	constructor(props) {
		super(props);
		this.state={
			login: true
		}
	}

	render() {
		return(
			<div className='vip'>VIP</div>
		)
	}

	componentDidMount() {
		axios.get('http://www.dell-lee.com/react/api/isLogin.json', {
			withCredentials: true
		})
			.then(res => {
				const login = res.data.data.login;
				this.setState({ login })
			})
	}
}

export default Vip;
